import React from "react";
// import "./style/nav.css";
import { SideNav, NavLinks, LinkStyle, NavIcon } from "./Common.js";
import Auth from "../../utils/auth.js";
import { Link } from "react-router-dom";
import Home from "../../assets/Home.png";
import Upload from "../../assets/Upload.png";
import Profile from "../../assets/Profile.png";

function sideNav() {
  const logout = (event) => {
    event.preventDefault();
    Auth.logout();
  };

  return (
    <SideNav>
      <NavLinks>
        <Link style={LinkStyle} to="/explore">Home</Link>
        {Auth.loggedIn() ? (
          <>
            <Link style={LinkStyle} to="/projectform"><NavIcon></NavIcon>Upload</Link>
            <Link style={LinkStyle} to="/profile">Profile</Link>
            <Link style={LinkStyle} onClick={logout} to="/">
              Logout
            </Link>
          </>
        ) : (
          <Link style={LinkStyle} to="/">Login</Link>
        )}
      </NavLinks>
    </SideNav>
  );
};

export default sideNav;
